interface State {
    user: any[];
  }

  type Action = {
    type: string;
    payload?: any;
  };

export type RootState = State;

const initialState: State = {
    user : [],
};

const rootReducer = (state = initialState, action: Action): State  => {
    switch(action.type){
        default: return { ...state };
    }
};

export default rootReducer;
